عرفِ عام ۾ قبلي مان مراد خانہ ڪعبو آھي جيڪو مسجد الحرام، مڪو، سعودي عرب ۾ واقع آھي ۽ مسلمان ان جي طرف رخ ڪري نماز پڙھندا آھن۔ ان کان علاوه احتراماً بہ ڪنھن شخص کي قبلو يا قبلو و ڪعبو چيو ويندو آھي۔
اسلام ۾ ھڪ مديني ڏانهن هجرت واري دؤر ۾ مسلمانن جو قبلو تبديل ٿيو ۽ آھي ڪعبي جي بدران بيت المقدس ڏانھن رخ ڪري نماز پڙھندا ھيا جيڪو مديني م رھندڙ يھودين جو به مقدس مقام ھيو. سن ٻہ ھجري ۾ رجب يا شعبان جي مھيني ۾ حضرت محمد صہ بشر بن براء بن معرور جي دعوت تي ويل ھو جتي ظھر جو وقت ھيو تہ پيغمبر صه نم
... (306 chars skipped) ... 
بق بيت المقدس مديني جي بلڪل اتر طرف ھيو ۽ ڪعبو ڏکڻ طرف ان ڪري نماز دوران رخ تبديل ڪرڻ ۾ مقتدين کي رخ مٽائڻ سان گڏ ڪجھ پنڌ ڪري نيون صفون ٺاھڻيون پيون ھونديون.[1] ڪعبو جي معني آھي چوڪنڊو . اھا مسجدالحرام جي وچ ۾ ھڪ چورس عمارت آھي . مسلمانن جو يقين آھي تہ اھا عمارت دنيا جي پھرين انسان آدم خدا جي حڪم سان تيار ڪئي ھئي جيڪا نوح جي دور م آيل ٻوڏ ۾ تباھ ٿي ويئي ۽ پوء ابراهيم ۽ ان جي پٽ اسماعيل خدا جي حڪم سان پراڻي بنياد تي سن جي نئين سر اڏاوت ڪئي ھئي.تفھيم القرآن مطابق مسجدالحرام جي معني آهي حرمت واري م
