قيق ممڪن نہ ھجي مثلاً ريل يا ٻيڙي ۾ تہ جنھن طرف بہ قبلي جو گمان ھجي ء جيتري قدر رخ ڪرڻ ممڪن ھجي نماز پڙھي سگھجي ٿي . جيڪڏهن نماز دوران صحيح رخ معلوم ٿي وڃي ۽ صحيح طرف منھن ڪرڻ ممڪن ھجي ته نماز دوران رخ تبديل ڪري سگھجي ٿو.[3]
